import React from 'react';
import PropTypes from 'prop-types';

export default function MobileInfoWindow({children}) {
  return (
    <div className="mobileInfoWindow">{children}</div>
  );
}

MobileInfoWindow.propTypes = {
  children: PropTypes.node.isRequired,
};
